import React from 'react';
import Navbar from './Navbar/Navbar'

function App() {
  return (
    <Switch>
      <Route exact path='/' component={Home} />
      <Route path='/about' component={About} />
      <Route path='/contactus' component={Contactus} />
    </Switch>
  )
}

export default App
